import React from "react";
import "./Prodotti.css";
import Viaggi from "../Immagini/aereo.png";
import Row from 'react-bootstrap/Row'

const Prodotti = () => {
<Container>
  <Row xs={2} md={4} lg={6}>
    <Col>1 of 2</Col>
    <Col>2 of 2</Col>
  </Row>
  <Row xs={1} md={2}>
    <Col>1 of 3</Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
  <Row xs="auto">
    <Col>1 of 3</Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>
};
export default Prodotti;
